struct TOLDInputs {
    
    var rampWeight: Double
    var takeOffWeight: Double
    var inputsUsed: [String: Any]
    var jsInputs: [String]
    
    init() {
        rampWeight = 0
        takeOffWeight = 0
        inputsUsed = [:]
        jsInputs = []
    }
    
    func printInputs() {
        print("aerobrake :: temp :: tempScale :: alt :: rwyLength :: rwyHDG :: windDir :: windVel :: rwySlope :: rcr :: acGrossWt :: podMounted :: givenEngFailAt")
        print("JavaScript Inputs: \(self.jsInputs)")
        for (key, value) in self.inputsUsed {
            print("\(key): \(value)")
        }
    }

    func getResults() -> (headWind: String?,
        crossWind: String?,
        macs: String?,
        macsDistance: String?,
        decisionSpeed: String?,
        refusalSpeed_EF: String?,
        setos: String?,
        speedAtEndOfRunway: String?,
        gearDnSECG: String?,
        gearUpSECG: String?,
        criticalFieldLength: String?,
        nacs: String?,
        refusalSpeedBEO: String?,
        rotationSpeed: String?,
        takeoffSpeed: String?,
        takeoffDistance: String?,
        criticalEngineFailureSpeed: String?,
        SpeedAtEndOfRunway_EF: String?,
        gearDnSECG_EF: String?,
        gearUpSECG_EF: String?,
//        ErrorMessages: Array<Any>?) {
        ErrorMessages: [Any?]?) {
            let jsC = JSContext()
            let told = T38TOLD().js
            jsC?.evaluateScript(told)
            let mainFunc = jsC?.objectForKeyedSubscript("mainInput")
            let resultDictionary = mainFunc?.call(withArguments: self.jsInputs)?.toDictionary()
            
            let headWind = resultDictionary?["HeadWind"] as? String
            let crossWind = resultDictionary?["CrossWind"] as? String
            let macs = resultDictionary?["MACS"] as? String
            let macsDistance = resultDictionary?["MACSDistance"] as? String
            let decisionSpeed = resultDictionary?["DS"] as? String
            let refusalSpeed_EF = resultDictionary?["RSEF"] as? String
            let setos = resultDictionary?["SETOS"] as? String
            let speedAtEndOfRunway = resultDictionary?["SAEOR"] as? String
            let gearDnSECG = resultDictionary?["GearDNSECG"] as? String
            let gearUpSECG = resultDictionary?["GearUPSECG"] as? String
            let criticalFieldLength = resultDictionary?["CFL"] as? String
            let nacs = resultDictionary?["NACS"] as? String
            let refusalSpeedBEO = resultDictionary?["RSBEO"] as? String
            let rotationSpeed = resultDictionary?["RotationSpeed"] as? String
            let takeoffSpeed = resultDictionary?["TakeoffSpeed"] as? String
            let takeoffDistance = resultDictionary?["TakeoffDistance"] as? String
            let criticalEngineFailureSpeed = resultDictionary?["CEFS"] as? String
            let SpeedAtEndOfRunway_EF = resultDictionary?["EFSAEOR"] as? String
            let gearDnSECG_EF = resultDictionary?["EFGearDNSECG"] as? String
            let gearUpSECG_EF = resultDictionary?["EFGearUPSECG"] as? String
            let ErrorMessages = resultDictionary?["ErrorMessages"] as! [Any?]?
            
            return (headWind: headWind,
                    crossWind: crossWind,
                    macs: macs,
                    macsDistance: macsDistance,
                    decisionSpeed: decisionSpeed,
                    refusalSpeed_EF: refusalSpeed_EF,
                    setos: setos,
                    speedAtEndOfRunway: speedAtEndOfRunway,
                    gearDnSECG: gearDnSECG,
                    gearUpSECG: gearUpSECG,
                    criticalFieldLength: criticalFieldLength,
                    nacs: nacs,
                    refusalSpeedBEO: refusalSpeedBEO,
                    rotationSpeed: rotationSpeed,
                    takeoffSpeed: takeoffSpeed,
                    takeoffDistance: takeoffDistance,
                    criticalEngineFailureSpeed: criticalEngineFailureSpeed,
                    SpeedAtEndOfRunway_EF: SpeedAtEndOfRunway_EF,
                    gearDnSECG_EF: gearDnSECG_EF,
                    gearUpSECG_EF: gearUpSECG_EF,
                    ErrorMessages: ErrorMessages)
    }
    
    
    
    
    
    
    
    init(aerobrake: Bool,
         aircraftBasicWeight: Double,
         podMounted: Bool,
         podType: PodType?,
         podCargoWeight: Double?,
         crewCompliment: CrewCompliment,
         dogHouseCargoWeight: Double?,
         gasWeight: Double,
         taxiTime: Double,
         temperature: Double,
         temperatureScale: TempScale,
         pressureAlt: Double,
         runwayLength: Double,
         runwayHeading: Double,
         windDirection: Double,
         windVelocity: Double,
         runwaySlope: Double,
         rcr: Double,
         givenEngFailAt: Double) {
        
        var crewAndDogHouseWeight   = 0.0
        var podWeight               = 0.0
        var rampWeight              = 0.0
        var takeOffWeight           = 0.0
        
        var jsAeroBrake             = ""
        var jsPodMounted            = ""
        var jsTemperatureScale      = ""
        
        switch aerobrake {
        case true:
            jsAeroBrake = "1"
        case false:
            jsAeroBrake = "0"
        }
        
        switch temperatureScale {
        case .C:
            jsTemperatureScale = "C"
        case .F:
            jsTemperatureScale = "F"
        }
        
        switch crewCompliment {
        case .solo:
            crewAndDogHouseWeight = crewCompliment.rawValue
        case .dual:
            crewAndDogHouseWeight = crewCompliment.rawValue
        case .dogHouse:
            crewAndDogHouseWeight = crewCompliment.rawValue + (dogHouseCargoWeight ?? 0.0)
        }
        
        switch podMounted {
        case true:
            jsPodMounted = "1"
            podWeight = (podType?.rawValue ?? 0) + (podCargoWeight ?? 0)
        case false:
            jsPodMounted = "0"
            podWeight = 0.0
        }
        
        //    aerobrake_, temp_, tempScale_, alt_, rwyLength_, rwyHDG_, windDir_, windVel_, rwySlope_, rcr_, acGrossWt_,podMounted_, givenEngFailAt_
        rampWeight = aircraftBasicWeight + crewAndDogHouseWeight + podWeight + gasWeight
        takeOffWeight = rampWeight - (18 * taxiTime)
        self.rampWeight = rampWeight
        self.takeOffWeight = takeOffWeight
        self.inputsUsed = ["Aerobrake: ": aerobrake,
                           "AC BasicWeight: ": aircraftBasicWeight,
                           "Pod Mounted: ": podMounted,
                           "Pod Type: ": podType ?? "No Pod",
                           "Pod Cargo Weight: ": podCargoWeight ?? "No Pod",
                           "Crew Compliment: ": crewCompliment,
                           "Doghouse Cargo: ": dogHouseCargoWeight ?? "No Dog House",
                           "Crew And Doghouse Weight": crewAndDogHouseWeight,
                           "Pod Weight" : podWeight, 
                           "Gas Weight: ": gasWeight,
                           "Taxi Time: ": taxiTime,
                           "Temperature: ": temperature,
                           "Temp Scale: ": temperatureScale,
                           "Pressure Alt: ": pressureAlt,
                           "Runway Length: ": runwayLength,
                           "Runway Heading: ": runwayHeading,
                           "Wind Direction: ": windDirection,
                           "Wind Velocity: ": windVelocity,
                           "Runway Slope: ": runwaySlope,
                           "RCR: ": rcr,
                           "RampWeight" : rampWeight,
                           "TakeOff Weight" : takeOffWeight,
                           "Given Engine Failure At" : givenEngFailAt]
            
        
        self.jsInputs = [jsAeroBrake,
                         String(temperature),
                         jsTemperatureScale,
                         String(pressureAlt),
                         String(runwayLength),
                         String(runwayHeading),
                         String(windDirection),
                         String(windVelocity),
                         String(runwaySlope),
                         String(rcr),
                         String(takeOffWeight),
                         jsPodMounted,
                         String(givenEngFailAt)]
        
    }
}

struct T38TOLD {
    
    let js = """

/******************************************************************************
* NCI Information Systems, Inc.                                               *
*******************************************************************************
* Module: T38TOLDConversions.js                                               *
* Date:   2013-11-26                                                          *
* Author: Jeff Peters                                                         *
* For:    United States Air Force, 394th CTS                                  *
*******************************************************************************
* DESCRIPTION                                                                 *
*******************************************************************************
* This module consists of logic converted from the Excel spreadsheet named    *
* TOLD_Calc_V4 012Sept13.xls.                                                 *
*******************************************************************************
* HISTORY                                                                     *
*******************************************************************************
* 2013-11-26 - finished initial code conversion and debugging                 *
* 2013-12-12 - Debugged KCAS2M(kc, alt)                                       *
*                                                                             *
*******************************************************************************
*/


var constTsl = 15;              // C
var constPsl = 2116.2;          // lbf/ft^2
var constRhosl = 0.0023772;     // slug/ft^3
var constGamma = 1.4;           // Ratio of specific heats
var constR = 3089.8136;         // Gas Constant ft^2/(s^2*K)
var constRR = 1716.546755;      // Gas Constant ft^2/(s^2*R)
var constAlapse = -0.00356616;  // R/ft
var constG = 32.1751969;        // ft/s^2

function Palt(alt) {  // Pressure [lb/ft^2]
  return delta(alt) * constPsl;
}

function rho(alt, TC) {  //Density [slug/ft^3]
  if (alt > 65617) {
    return "error altitude > 65617";
  }
  var p = Palt(alt);
  var t = TC2K(TC);
  var r = p / (constR * t);
  return r;
}

function theta(alt) {    //Temperature Ratio
  var T = TC2R(constTsl);
  if (alt < 36089) {
    th = 1 * 1 + constAlapse * alt / T;
  }
  if (alt >= 36089) {
    th = 1 * 1 + constAlapse * 36089 / T;
  }
  if (alt > 65617) {
    th = "error altitude > 65617";
  }
  return th;
}


function delta(alt) {   // Pressure Ratio
  if (alt < 36089) {
    d = Math.pow(theta(alt),(-constG / (constAlapse * constRR)));
  }
  if (alt >= 36089) {
    d = 0.2234 * Math.exp(-(alt - 36089) / 20806.7);
  }
  if (alt > 65617) {
    d = "error altitude > 65617";
  }
  return d;
}

function TF2C(TF) {
  var t = (TF - 32) / 1.8;
  return t;
}

function TC2K(TC) {
  var t = TC * 1.0 + 273.15;
  return t;
}

function TC2R(TC) {
  var t = TC * 1.8 + 32 + 459.67;
  return t;
}


function SS(TC) {
  var t = TC2K(TC);
  var ss = Math.pow(constGamma * constR * t, 0.5);
  return ss;
}

function KT2fps(Vkt) {
  var k = 1.687809857 * Vkt;
  return k;
}


function fps2KT(Vfps) {
  var v = Vfps / 1.687809857;
  return v;
}

function KCAS2M(kc, alt) {
  var Va1 = SS(15);
  var Va = fps2KT(Va1);
  var del = delta(alt);
  // The following statements reduce this VBA expression's complexity: a = ((1 + ((gamma - 1) / 2) * ((KCAS / Va) ^ 2)) ^ (gamma / (gamma - 1)) - 1) / del
  var p = constGamma - 1;
  var q = constGamma/p;
  var r = p/2;
  var s = Math.pow(kc/Va,2);
  var t = 1 * 1 + r * s;
  // So the reduced complexity version is on the next line
  var a = (Math.pow(t,q) - 1)/del;
  
  var b = ((Math.pow(a + 1 * 1,p/constGamma) - 1) * 2) / p;
  var k = Math.pow(b,0.5);
  return k;
}
  
function KCAS2KTAS(kc, alt, TC) {
  var M = KCAS2M(kc, alt);
  var Va1 = SS(TC);
  var Va = fps2KT(Va1);
  var k = M * Va;
  return k;
}


